;; **
;;; It works. Let's check how the average policy converges.
;; **

;; @@
(def average-policy
  (loop [ap []
         sum 0.
         n 0
         policy policy]
    (if-let [[q & policy] (seq policy)]
      (let [sum (+ sum q)
            n (inc n)]
        (recur (conj ap (/ sum n)) sum n policy))
      ap)))
(plot/list-plot average-policy)
